import React, { Component } from "react";
import { Layout, Navigation, Header, Drawer, Content, Footer } from "react-mdl";
import "./App.css";
import AboutMeComponent from "../src/component/AboutMeComponent";
import AboutUnsplashComponent from "../src/component/AboutUnsplashComponent";
import ContactComponent from "../src/component/ContactComponent";
import { Route, Switch } from "react-router-dom";
import NotFound from "./component/NotFound";


class App extends Component {
  render() {
    return (
      <div className="appJs">
        {/* Uses a header that scrolls with the text, rather than staying locked at the top */}
        <div className="demo-big-content" id="navBar">
          <Layout>
            <Header title="Title" scroll>
              <Navigation>
                <a href="#">Link</a>
                <a href="#">Link</a>
                <a href="#">Link</a>
                <a href="#">Link</a>
              </Navigation>
            </Header>
            <Drawer title="Title">
              <Navigation>
                <a href="#">Link</a>
                <a href="#">Link</a>
                <a href="#">Link</a>
                <a href="#">Link</a>
              </Navigation>
            </Drawer>
            <Content>
              <div className="page-content" />
            </Content>
          </Layout>
        </div>

        <div className="displayMain">
          <div className="innerDisplayMainLeft"></div>
          <div className="innerDisplayMainRight">
            <Switch>
              <Route exact path='/' />
              <Route exact path='/AboutMeComponent' component={AboutMeComponent}/>
              <Route exact path='/AboutUnsplashComponent' component={AboutUnsplashComponent}/>
              <Route exact path='/ContactComponent' component={ContactComponent}/>                
              <Router component={NotFound}></Router>
            </Switch>
          </div>
        </div>

        <div className="footer">
          <Footer />
        </div>
      </div>
    );
  }
}

export default App;
